USE [a1]
GO

CREATE TABLE [agenda](
	[cd_agenda] [int] NOT NULL,
	[cd_paciente] [int] NOT NULL,
	[cd_profissional] [int] NOT NULL,
	[dt_inicio] [datetime] NOT NULL,
	[dt_fim] [datetime] NOT NULL,
 CONSTRAINT [pk_agenda] PRIMARY KEY CLUSTERED 
(
	[cd_agenda] ASC
)
) ON [PRIMARY]
GO

CREATE TABLE [paciente](
	[cd_paciente] [int] NOT NULL,
	[nm_paciente] [varchar](100) NOT NULL,
 CONSTRAINT [pk_paciente] PRIMARY KEY CLUSTERED 
(
	[cd_paciente] ASC
)
) ON [PRIMARY]
GO

CREATE TABLE [profissional](
	[cd_profissional] [int] NOT NULL,
	[nm_profissional] [varchar](50) NOT NULL,
 CONSTRAINT [pk_profissional] PRIMARY KEY CLUSTERED 
(
	[cd_profissional] ASC
)
) ON [PRIMARY]
GO

CREATE TABLE [resultado_natacao](
	[nome_atleta] [varchar](255) NULL,
	[data_competicao] [date] NULL,
	[tempo] [numeric](5, 2) NULL,
	[modalidade] [varchar](50) NULL
) ON [PRIMARY]
GO
